import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import '../css/Header.css';
import '../css/Fade.css';

var createReactClass = require('create-react-class');


var Name = createReactClass( {
    componentDidMount () {
        this.setState( { value: "Matthew Cline's Resume"} );
    },
    handleClick: function() {
        this.setState({
            condition: !this.state.condition
        });
    },
    render: function() {
        return (
            <div className="HeaderName">[this.state.value]</div>
        )
    }
});


export default class Header extends Component {



    componentDidMount () {

        setTimeout( function() {
            ReactDOM.render(<Name />, document.getElementById('HeaderBackground'));
        }, 500);

    }

    render() {
        return (
            <div className="Header fade-in">
                <div id="" className="HeaderBackground"></div>
            </div>
        );
    }
}
